import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';

const events = [];

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      eventList: events,
    };
  }

  render() {
    return (
      <main className='context'>
        <nav className='nav bg-dark text-white px-4 py-3'>
          <span className='logo'>
            SeatFinder
          </span>
          <div className='float-end'>
            Home | About | Contact
          </div>
        </nav>
      </main>
    );
  }
}

export default App;
